import React, { Component } from 'react';
import './RangeSlide.css';
class RangeSlide extends Component {
    render() {
        return (
            <div className="slide-range">
                <input type="range" min="1" max="100" className="slider"></input>
            </div>
        );
    }
}

export default RangeSlide;
